import "./App.css";
import NewsTop from "./components/NewsTop";
import Register from "./components/Register";
import { BrowserRouter, Route, Switch } from "react-router-dom";
import NewsForDate from "./components/NewsForDate";
import { Navigation } from "./components/Navigation/Navigation";
import { NewsSinglePage } from "./components/NewsSinglePage";
import NewsCategory from "./components/NewsCategory";

function App() {
  return (
    <BrowserRouter>
      <Navigation />
      <div className="App">
        <Switch>
          <Route path="/register">
            <Register />
          </Route>
          <Route path="/NewsForDate">
            <NewsForDate />
          </Route>
          <Route path="/NewsCategory">
            <NewsCategory />
          </Route>
          <Route path="/news/:id">
            <NewsSinglePage />
          </Route>
          <Route path="/">
            <NewsTop />
          </Route>
        </Switch>
      </div>
    </BrowserRouter>
  );
}

export default App;
